        public async Task<string> ExecuteFolderShare(string apiKey, string subject, string message, string email)
        {
            try
            {
                var client = new SendGridClient(apiKey);

                Attachment attachment = new Attachment();
                attachment.ContentId = "imgLogo";
                attachment.Content = "";
                attachment.Type = "image/png";
                attachment.Disposition = "inline"; // fixed the issue
                attachment.Filename = "logo.png";

                var msg = new SendGridMessage()
                {
                    From = new EmailAddress(Options.SendGridEmail, "Data Enterprise Atlas"),
                    Subject = subject,
                    PlainTextContent = message,
                    HtmlContent = message,
                    ReplyTo = new EmailAddress(Options.SendGridEmail)
                };
                msg.AddAttachment(attachment);
                msg.AddTo(new EmailAddress(email));

                // Disable click tracking.
                // See https://sendgrid.com/docs/User_Guide/Settings/tracking.html
                msg.SetClickTracking(false, false);
                var err = await client.SendEmailAsync(msg);
                var statuscode=(int)err.StatusCode;

                if(statuscode==250 || statuscode == 202)
                {
                    return "Shared Successfully";
                }
                else
                {
                    return GetMessageForStatus(statuscode);
                }

                
            }
            catch (System.Exception)
            {

                return "Unable to share,Please try again.." ;
            }

           
        }



        public async Task<bool> ExecuteDiagram(string apiKey, string subject, string message, string email, string fileName)
        {
            var client = new SendGridClient(apiKey);

            Attachment attachment = new Attachment();
            attachment.ContentId = "imgLogo";
            attachment.Content = "";
            attachment.Type = "image/png";
            attachment.Disposition = "inline"; // fixed the issue
            attachment.Filename = "logo.png";

            var msg = new SendGridMessage()
            {
                From = new EmailAddress(Options.SendGridEmail, "Data Enterprise Atlas"),
                Subject = subject,
                PlainTextContent = "Please download the attachment to get diagram XML",
                HtmlContent = "Please download the attachment to get diagram XML <br/><br/>Thank you,<br/>Sales Team <br/><br/><img src='cid:imgLogo' width='100' height='80' style='width:100px;height80px;'/>",
                ReplyTo = new EmailAddress(Options.SendGridEmail),
               
            };



            MemoryStream memoryStream = new MemoryStream(Encoding.UTF8.GetBytes(message));
            memoryStream.Seek(0, SeekOrigin.Begin); // Reset stream back to beginning
            await msg.AddAttachmentAsync( fileName, memoryStream);
            msg.AddAttachment(attachment);
            msg.AddTo(new EmailAddress(email));

            // Disable click tracking.
            // See https://sendgrid.com/docs/User_Guide/Settings/tracking.html
            msg.SetClickTracking(false, false);
            var err = await client.SendEmailAsync(msg);
            var statuscode = (int)err.StatusCode;
            if (statuscode == 250 || statuscode == 202)
            {
                return true;
            }
            else
            {
                return false;
            }
        }

        private string GetMessageForStatus(int statuscode)
        {
            if(statuscode==403)
            {
                return "You are not authorized to send from that email address";
            }
            else
            {
                return "Temporary local problem - please try later(" + statuscode.ToString() + ")";
            }

        }
    }
